/** @jsxRuntime classic */
/** @jsx jsx */
import { useState } from "react";
import { jsx, Styled } from "theme-ui";

export default function Button(props) {
  return (
    <Styled.a>
      <Styled.div
        sx={{
          cursor: "pointer",
          m: 0,
          backgroundColor: "red",
          p: 1,
        }}
      >
        <Styled.h5>{props.data}</Styled.h5>
      </Styled.div>
    </Styled.a>
  );
}
